// 	"description":"Buying Home, Selling America: the House Catalog, 1906-1966 brings to light the collection of house catalogs in the Art, Architecture & Engineering Library\u2019s Special Collections. Focusing primarily on the kit house industry of Michigan and the Midwest, the catalogs provide a portal to explore multiple themes, such as, the Michigan house catalog industry, changing architectural styles, the business of selling homes, societal and cultural implications, and domestic technologies. We hope the exhibit is not simply a nostalgic view back, but raises awareness of our domestic surroundings today and compels us to ask questions as we look to the future.\r\n\r\nThe exhibit is available in the Clark Library (second floor Hatcher) during Hatcher Library hours.",
