// 	"description":"Connections, New Beginnings: Artists in Transition features the work of artists in the Linkage Project, a program of the Prison Creative Arts Project (PCAP) that affirms the creativity of adults who have returned from incarceration. The artists previously exhibited their work at PCAP's Annual Exhibition of Art by Michigan Prisoners at the University of Michigan. For some, this exhibition at the MSU Broad Art Lab is the first opportunity to show their work since regaining their freedom. Art-making has helped these artists during the dark years of their incarceration, and we hope the exhibition inspires visitors to learn more about how to support formerly incarcerated people reconnecting with their communities.\r\n\r\nMart\u00edn Vargas, artist and curator of this exhibition, invites visitors and supporters to not only connect with the artists through their work, but also during select Art Lab studio hours, which will feature several of the artists working in person.\r\n\r\nConnections, New Beginnings: Artists in Transition is organized by the Linkage Project of the Prison Creative Arts Project at the University of Michigan in partnership with the Eli and Edythe Broad Art Museum at Michigan State University. The exhibition is curated by Mart\u00edn Vargas, Vanessa Mayesky, Scott Tompkins, Nico Slowik, Kimiko Uyeda, and Jenna VanFleteren.",
